uint8_t str_buffer[100];

uint16_t frame_rows[] = { 400, 1200, 2000, 2800 };
uint8_t frame;

void set_frame(uint8_t idx) {
    frame = idx;
    uint16_t addr = frame_rows[idx];
    for (uint8_t row = 16; row <= 23; row++, addr += 100) {
        mage_set_row_addr(row, addr);
    }
}

void set_frame_by_row(uint8_t row) {
    if (row >= 28) {
        if (frame != 2) {
            set_frame(2);
        }
    } else if (row >= 20) {
        if (frame != 1) {
            set_frame(1);
        }
    } else if (row >= 12) {
        if (frame != 0) {
            set_frame(0);
        }
    } else if (frame != 3) {
        set_frame(3);
    }
}

void show_frame(uint8_t row) {
    if (row >= 28) {
        if (frame != 2) {
            mage_render_range(2000, 2800);
            set_frame(2);
        }
    } else if (row >= 20) {
        if (frame != 1) {
            mage_render_range(1200, 2000);
            set_frame(1);
        }
    } else if (row >= 12) {
        if (frame != 0) {
            mage_render_range(400, 1200);
            set_frame(0);
        }
    } else if (frame != 3) {
        mage_render_range(2800, 3600);
        set_frame(3);
    }
}

